// Cette component est pour definir About
//import '../../App.css';
import './About.css';
import React from 'react';
import welcomImage from '../../assets/welcomImg.png';
//import { HomeContainer,leftside,rightside } from './HomeElements';
//style={{ backgroundColor: "#" + `${randomColor}` }}
//let randomColor = Math.floor(Math.random() * 16777215).toString(16);
function About(){
    return (
        <div>
            <div class="container2" >
                <div class="left-side1">
                  <img class="labo1" src={welcomImage} alt= "Hello" />
                </div>
                <div class="right-side1">
                    <div class="pg">
                    Cette application web a été créée par une équipe d'éudiants de l'Ecole Centrale de Nantes dans 
                    le contexte d'un projet de groupe en option Informatique en 2021.Le suivi de l'application 
                    a été confiée à la DSI de l'université de Nantes.
                    </div>
                </div>
            </div>
        </div>
    );
};

export default About;
